import {makeAutoObservable} from "mobx"

class OneUser {
    constructor(id,fn,sn,img,email,mark,countState,isAdmin){
        this._id =  id;
        this._fn = fn;
        this._sn = sn;
        this._img = img;
        this._email = email;
        this._mark = mark;
        this._countState = countState;
        this._isAdmin = isAdmin;
    }
};



export default class UsersConteiner{
    constructor(){
        this._users = [
            new OneUser(1, "Филатьев", "Владислав", "../img/defaut_awatar.jpg", "fill@yandex.ru",
            4.5, 102, false
        ),
        new OneUser(2, "Иванов", "Сергей", "../img/defaut_awatar.jpg", "Invanow@mail.ru",
            3.2, 11, false
        )
        ]
        makeAutoObservable(this)
    }


    setUsers(users){
        this._users = users
    }

    get users(){
        return this._users
    }

    

}
